import { Component, OnDestroy, OnInit } from '@angular/core';
import { MatDialogRef } from '@angular/material/dialog';
import { Store } from '@ngrx/store';
import { ReplaySubject, takeUntil } from 'rxjs';
import { DogModel } from 'src/app/shared/model/dog.model';
import { DogActions } from 'src/app/shared/state/dogs.actions';
import {
  selectFilteredDogsState,
  selectSelectedDog,
} from 'src/app/shared/state/dogs.selector';

@Component({
  selector: 'doggy-info',
  templateUrl: './info.component.html',
  styleUrls: ['./info.component.scss'],
})
export class InfoComponent implements OnInit, OnDestroy {
  filteredIds$ = this.store.select(selectFilteredDogsState);
  filteredIds: Array<string> = [];
  dog$ = this.store.select(selectSelectedDog);
  dog?: DogModel;
  private destroyed$: ReplaySubject<boolean> = new ReplaySubject(1);

  constructor(
    private store: Store,
    public dialogRef: MatDialogRef<InfoComponent>
  ) {}

  ngOnInit(): void {
    this.dog$.pipe(takeUntil(this.destroyed$)).subscribe(dog => {
      if (dog) this.dog = dog;
    });

    this.filteredIds$.pipe(takeUntil(this.destroyed$)).subscribe(ids => {
      this.filteredIds = ids;
    });
  }

  ngOnDestroy(): void {
    this.destroyed$.next(true);
    this.destroyed$.complete();
  }

  nextDog() {
    const currentIndex = this.filteredIds.indexOf(this.dog?.id || '');
    const newIndex =
      currentIndex === this.filteredIds.length - 1 ? 0 : currentIndex + 1;
    const dogId = this.filteredIds[newIndex];

    this.store.dispatch(DogActions.selectDog({ dogId }));
  }

  previousDog() {
    const currentIndex = this.filteredIds.indexOf(this.dog?.id || '');
    const newIndex =
      currentIndex === 0 ? this.filteredIds.length - 1 : currentIndex - 1;
    const dogId = this.filteredIds[newIndex];

    this.store.dispatch(DogActions.selectDog({ dogId }));
  }

  close() {
    this.dialogRef.close();
  }
}
<h2 mat-dialog-title>{{ dog?.name }}</h2>

<mat-dialog-content>
  <div class="content-wrapper">
    <div class="image-wrapper">
      <img
        [src]="dog?.image?.url || ''"
        [width]="dog?.image?.width"
        [height]="dog?.image?.height"
        [alt]="dog?.name"
        la />
    </div>
    <div class="info-wrapper">
      <dl>
        <dt>Breed Group</dt>
        <dd>{{ dog?.breed_group }} Pounds</dd>
        <dt>Weight</dt>
        <dd>{{ dog?.weight?.imperial }} Pounds</dd>
        <dt>Height</dt>
        <dd>{{ dog?.height?.metric }} Centimeters</dd>
        <dt>Life-span</dt>
        <dd>{{ dog?.life_span }}</dd>
        <dt>Temperament</dt>
        <dd>{{ dog?.temperament }}</dd>
        <dt *ngIf="dog?.origin">Origin</dt>
        <dd>{{ dog?.origin }}</dd>
      </dl>
    </div>
  </div>
</mat-dialog-content>
<mat-dialog-actions align="center">
  <button mat-icon-button (click)="previousDog()">
    <mat-icon>arrow_back</mat-icon>
  </button>
  <button mat-button color="primary" cdkFocusInitial (click)="close()">
    Close
  </button>
  <button mat-icon-button (click)="nextDog()">
    <mat-icon>arrow_forward</mat-icon>
  </button>
</mat-dialog-actions>
